let intervalId;$(function(){void 0!==ids_to_check_progress&&ids_to_check_progress.length>0&&(intervalId=setInterval(function(){$.post({url:admin_url+"actions/video_progress.php",dataType:"json",data:{ids:ids_to_check_progress,output:"line"},success:function(t){t.data.videos.forEach(function(t){$('tr[data-id="'+t.videoid+'"').replaceWith(t.html)}),t.all_complete&&clearInterval(intervalId)}})},3e4))});
